import logo from './logo.svg';
import './App.css';
import UserInput from './Components/UserInput'
import UserOutput from './Components/UserOutput'

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <UserInput />
        <UserOutput />
      </header>
    </div>
  );
}

export default App;
